function owlCarouselInit(owlCarouselSelector, items) {
    owlCarouselSelector.owlCarousel({
        items: items, //10 items above 1000px browser width
        itemsDesktop: [1000, 2], //5 items between 1000px and 901px
        itemsDesktopSmall: [900, 2], // 3 items betweem 900px and 601px
        itemsTablet: [600, 2], //2 items between 600 and 0;
        itemsMobile: [450, 1] // itemsMobile disabled - inherit from itemsTablet option
    });
    setTimeout(function () {
        owlCarouselSelector.each(function () {
            if ($(this).find('div.owl-item').length <= items)
                $(this).parent().find('div.customNavigation').hide();
        });
    }, 1000);
    // Custom Navigation Events
    owlCarouselSelector.parent().find('div.customNavigation').children('a').click(function () {
        var owl = $(this).parent().parent().parent().parent().find(owlCarouselSelector);
        if ($(this).attr('data-val') == 'play')
            owl.trigger('owl.' + $(this).attr('data-val'), 2000);
        else owl.trigger('owl.' + $(this).attr('data-val'));
    });
}
